import React from 'react';
import axios from 'axios';

export default class CardList extends React.Component {
    constructor(props){
        super(props)
        this.state = {cards:[]}
    }

    componentDidMount(){
        axios.get("http://localhost:3000/cardlist")
        .then(response=>{
            this.setState({cards: response.data})
        })
    }
 
        
    
    render(){
        return(
            <div classname="ui center container">
                {this.state.cards.map(card=><div className="ui item" >{card.name}</div>)}
            </div>
        )
    }
}
